cursor = db.cursor()
def FoodRet():
    try:
       # Execute the SQL command
         cursor.execute("Select htl_name,scr from FOODLIST order by Score DESC")
         results=cursor.fetchall()
       # Commit your changes in the database
         db.commit()
    except:
   # Rollback in case there is any error
         db.rollback()
    return results
